  - name: $$FormScript
    type: text
    data: |
      '++LotusScript Development Environment:2:5:(Options):0:66
      
      '++LotusScript Development Environment:2:5:(Forward):0:1
      Declare Sub Querysave(Source As Notesuidocument, Continue As Variant)
      
      '++LotusScript Development Environment:2:5:(Declarations):0:2
      
      '++LotusScript Development Environment:2:2:Querysave:1:12
      Sub Querysave(Source As Notesuidocument, Continue As Variant)
      	Dim thisDoc As NotesDocument
      	Dim argCount As Integer
      	Dim optionalArgFlag As Integer
      	Dim a As Integer, ai As Integer, c As Integer
      	
      	Dim tempArgName As String
      	Dim tempArgType As String    
      	Dim tempArgByVal As String     
      	Dim tempArgOptional As String
      	Dim tempArgOptionalValue As String
      	Dim tempArgConst As String
      	Dim tempArgNameLength As Integer
      	Dim strChar As String 
      	
      	Dim errtxt As String, efldname As String
      	
      	On Error Goto errHandler
      	Set thisDoc = Source.document
      	
      	optionalArgFlag = False
      	argCount = Cint(thisDoc.getItemValue("F_TempArgCount")(0))     
      	
      	
      	For a = 1 To argCount		
      		tempArgName = thisDoc.getItemValue("F_ArgName_" & Cstr(a))(0)  
      		tempArgType = thisDoc.getItemValue("F_ArgDataType_" & Cstr(a))(0)
      		tempArgByVal = thisDoc.getItemValue("F_ArgByVal_" & Cstr(a))(0)
      		tempArgOptional = thisDoc.getItemValue("F_IsOptional_" & Cstr(a))(0)          
      		tempArgOptionalValue = thisDoc.getItemValue("F_OptionalValue_" & Cstr(a))(0)
      		tempArgConst = thisDoc.getItemValue("F_IsConst_" & Cstr(a))(0)
      		tempArgNameLength = Len(tempArgName)
      		
                ' Make sure project name is less than 32 characters.
      		If (tempArgNameLength > 32) Then
      			efldname = "F_ArgName_" & Cstr(a)
      			errtxt = "Argument names must be less than 32 characters."   
      			Error 1000, errtxt
      		End If  
      		
      		For c = 1 To tempArgNameLength
      			
      			strChar = Mid$(tempArgName , c, 1)
      			
                     ' Include list 
      			If Not (strChar)  Like "[0-9A-Za-z_]" Then                    
      				efldname = "F_ArgName_" & Cstr(a)
      				errtxt = "Argument """ & tempArgName & """ contains invalid character(s)."   
      				Error 1000, errtxt
      			Elseif(c = 1) And Isnumeric(strChar) Then
      				efldname = "F_ArgName_" & Cstr(a)
      				errtxt = "Argument """ & tempArgName & """ is not valid. The first character of an identifier name must be a nondigit."  
      				Error 1000, errtxt 
      			End If
      			
      		Next c
      		
      		For ai = a + 1 To argCount	
      			efldname = "F_ArgName_" & Cstr(ai)
      			If(strcmp(tempArgName, thisDoc.getItemvalue(efldname)(0))) Then     
      				errtxt = "Duplicate Argument name."  
      				Error 1000, errtxt          
      			End If			
      		Next ai 
      		
                ' Fixes problem (described above) with the F_ArgDataType exit field event 
                ' not firing on save but causes a two save prompts when <esc> is used to 
                ' exit a modified doc when the user is in a "F_ArgDataType*" field. 
                ' See comment below.     
                ' Begin Fix =====================================================
      		If (Source.CurrentField Like "F_ArgDataType*") Then
      			If (Source.CurrentField = "F_ArgDataType_" & Cstr(a)) Then
      				If(Source.FieldGetText("F_ArgDataType")<>tempArgType) Then                         
      					Call clearArgumentOptions(Source, a )
      					Print "Options cleared for " & tempArgName & "..."
      				End If               
      			End If
      		End If   
                ' End Fix ========================================================
      		
                ' Args passed by ref and optional must be const ( C++ Requirement)
      		If(tempArgByVal = "" And  tempArgOptional  <> "" And tempArgConst = "") Then
      			Call thisDoc.replaceItemValue("F_IsConst_" & Cstr(a), "CONST")
      		End If
                ' End - This code can be remove if a better work around becomes available. 
                '========================================================================
      		
                ' All trailing arguments after the first optional must be optional
      		If (optionalArgFlag = False) Then
      			If( thisDoc.getItemValue("F_IsOptional_" & a)(0) = "OPTIONAL") Then
      				optionalArgFlag = True 
      			End If
      		Else
      			If( Not thisDoc.getItemValue("F_IsOptional_" & a)(0) = "OPTIONAL") Then
      				efldname = "F_ArgName_" & Cstr(a)
      				errtxt = "All subsequent arguments must be optional."  
      				Error 1000, errtxt 
      			End If 
      		End If
      		
      	Next a  
      	
      getOut:
      	Exit Sub
      	
      errHandler:
      	Continue = False
      	Select Case Err
      	Case 1000
      		errtxt = Error$
      		If efldname <> "" Then Call source.GotoField(efldname)
      		efldname = ""
      	Case 1001 To 1050
      		errtxt = Error$ & " (ln: " & Erl & ")"
      	Case Else
      		errtxt = Error$ & "(er: " & Err & "; ln: " & Erl & ")"
      	End Select
      	
      	Msgbox errtxt,, "VSID Error"
      	Resume getOut
      End Sub
      '++LotusScript Development Environment:2:2:BindEvents:1:129
      Private Sub BindEvents ( Byval ObjectName_ As String )
      	Static Source As NOTESUIDOCUMENT
      	Set Source = Bind(Objectname_)
      	On Event QUERYSAVE From Source Call QUERYSAVE
      End Sub
    signed: true
    nonsummary: true
